measurements.description:
Four hundred fifty-seven flowers and 45 buds on 30 up to 22-cm arched inflorescences;
 47-cm by 29-cm plant gracefully blooming on a 7.5-cm by 21-cm wooden mount;
flowers golden yellow; sepals slender; petals ovate, slightly rolled on upper margins;
lip semi-saccate; 

 substance hard; texture waxy; the plant was immaculate and the overall appearance was improved by the more compact blooming compared with 
 the previous award #20245351.
